import { getAllPosts } from "../lib/api";

const HomePage = (props) => {
    console.log(props);
    return (
        <div>
            Coucou la famille!
        </div>
    );
};

export function getStaticProps() {
    const posts = getAllPosts();
    return {
        props: {
            posts,
        }
    };
}

export default HomePage;
